import React from 'react'
import styles from './Home.module.css';

export default function Home() {
    return (
        <div className={styles['Home']}>
            <h1 style={{color: 'white'}}>Welcome To Cyber Tilt Tool Project</h1>
            <br/>
            
            <button className={styles["button-92"]}>Profile</button>
            <button className={styles["button-92"]}>Reports</button>
            <button className={styles["button-92"]}>Company Users</button>
            <button className={styles["button-92"]}>System Users</button>
            <button className={styles["button-92"]}>Company - Authorization</button>
            <button className={styles["button-92"]}>System - Authorization</button>
        </div>
    )
}
